import Vue from "vue";
import VueRouter from "vue-router";
import AddOrder from "@/components/AddOrder";
import MyShop from "@/components/MyShop";
import MyOrder from "@/components/MyOrder";
import DelShop from "@/components/DelShop";
import DelLocation from "@/components/DelLocation";
import AddLocation from "@/components/AddLocation";
import AddShop from "@/components/AddShop";

Vue.use(VueRouter)
const vueRouter = new VueRouter({
    routes:[
        {path:'/AddOrder',component:AddOrder},
        {path:'/MyShop',component:MyShop},
        {path:'/MyOrder',component:MyOrder},
        {path:'/DelShop',component:DelShop},
        {path:'/DelLocation',component:DelLocation},
        {path:'/AddLocation',component:AddLocation},
        {path:'/AddShop',component:AddShop},
        {path:'/1',component:MyShop},
        {path:'/2',component:MyOrder},
    ]
});
export default vueRouter
